    //                 }
    //             ],
    //             attribute_sub_groups: {
    //                 workload_clinical_activities_administration: {
    //                     attributes: [
    //                         {
    //                             attribute_id: "28fce527-0ec2-4468-b309-5abc6d5060ba",
    //                             attribute_code: "adminstration_total_time_spent",
    //                             frontend_label: "Total time spent",
    //                             frontend_input: "input_time",
    //                             attribute_type: "time",
    //                             is_required: true,
    //                             note: "",
